body:
@TrumpTrain BREAKING: 

After the Secretary of State ordered the voting machines to be wiped in a blatant destruction of evidence, coalition groups plan to OCCUPY THE STATE CAPITOL in Georgia on Monday November 30 at 12pm. 

They also plan to protest outside the Sec. of States house at 6pm.

